import close_btn from "../statics/close_btn.svg";

export default function TaskNavigation(props) {
    return <div className="task-navigation-container">
        <button className="prev-task" onClick={props.handleNavifationButtonClick('prev')}><img className="close-btn-img" src={close_btn} alt="X"></img> Previous Task</button>
        <button className="next-task" onClick={props.handleNavifationButtonClick('next')}>Next Task</button>
    </div>
}
